import React from "react";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

const SearchResult = ({ data }) => {
  return data.map((user, itemIndex) => (
    <div style={{marginBottom:"2px", border:"1px solid black", border}}>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-between",
          width: "600px",
          padding:"5px"
        }}
      >
        <div style={{ display: "flex", flexDirection: "row" ,marginTop:"10px"}}>
          <div>
            <AccountCircleIcon></AccountCircleIcon>
            <img></img>
          </div>
          <div style={{ marginLeft: "10px", textTransform:"capitalize" }}>
            <p>{user.name}</p>
          </div>
        </div>
        <div>
          <button className="follow-button" style={{marginTop:"10px"}}>Follow</button>
        </div>
      </div>
    </div>
  ));
};

export default SearchResult;
